//TestCase Options
//set Options for timeout

//timeout of testcase 40s for every TestStep
def timeoutNew= 0
for (a = 0; a <runner.testSuite.testCaseCount; a++) {
def timeoutWithCalculation =runner.getTestSuite().getTestCaseAt(a).getTestStepCount()*60000000

//get
timeoutNew = runner.getTestSuite().getTestCaseAt(a).config.timeout

 runner.getTestSuite().getTestCaseAt(a).config.timeout = timeoutWithCalculation
 runner.getTestSuite().getTestCaseAt(a).config.failOnError = false
 runner.getTestSuite().getTestCaseAt(a).config.failTestCaseOnErrors = true
 runner.getTestSuite().getTestCaseAt(a).config.keepSession = true
 runner.getTestSuite().getTestCaseAt(a).config.searchProperties = true
 runner.getTestSuite().getTestCaseAt(a).config.wsrmEnabled = false
 runner.getTestSuite().getTestCaseAt(a).config.amfAuthorisation = false
}
